import React from "react";
import "./homepage.css";
import Disco from "./Disco.js"
import GoLive from "./GoLive.js";
import Testimonials from "./Testimonials.js";
import UseAPI from "./UseAPI.js";
import Services from "./Services.js";
import Support from "./Support.js";
import Hero from "./Hero.js";

class Home extends React.Component {

  render() {
    return (
      <div>
        {/* <body> */}

        {/* <!-- ======= Header ======= --> */}
        <header id="header" className="fixed-top">
          <div className="container d-flex align-items-center justify-content-between">

            <h1 className="logo"><a href="index.html">
              <img alt="" src={require("../layout/assets/img/buypower-logo.png").default} /></a>
            </h1>
            {/* <!-- Uncomment below if you prefer to use an image logo --> */}

            <nav id="navbar" className="navbar">
              <ul>
                <li><a className="nav-link scrollto" href="/team">FAQs</a></li>
                <li><a className="nav-link scrollto pre-btn" href="/contact">Contact us</a></li>
                <li><a className="btn-get-started scrollto" href="/about">Get Started</a></li>
              </ul>
              <i className="bi bi-list mobile-nav-toggle"></i>
            </nav>
            {/* <!-- .navbar --> */}

          </div>
        </header>
        {/* <!-- End Header --> */}

        {/* <!-- ======= Hero Section ======= --> */}
        <Hero />
        {/* <!-- End Hero --> */}

        <main id="main">

          {/* <!-- ======= About/disco Section ======= --> */}
          <Disco />
          {/* <!-- End About/disco Section --> */}

          {/* <!-- ======= Services Section ======= --> */}
          <Services />
          {/* <!-- End Sevices Section --> */}

          {/* <!-- ======= Frequently Asked Questions Section ======= --> */}
          <GoLive />
          {/* <!-- End Frequently Asked Questions Section --> */}

          {/* <!-- ======= Support Section ======= --> */}
          <Support />
          {/* <!-- End Support Section --> */}

          {/* <!-- ======= Testimonials Section ======= --> */}
          <Testimonials />
          {/* <!-- End Testimonials Section --> */}

          {/* <!-- ======= Cta Section ======= --> */}
          <UseAPI />
          {/* <!-- End Cta Section --> */}

        </main>
        {/* <!-- End #main --> */}

        {/* <!-- ======= Footer ======= --> */}
        <footer id="footer" className="text-center section-bg">

          <div className="footer-top">
            <div className="container footer-links">
              <ul className="footer-link">
                <li>
                  <a href="/">Buy Electricity</a>
                </li>
                <li>
                  <a href="/">Press</a>
                </li>
                <li>
                  <a href="/">FAQs</a>
                </li>
                <li>
                  <a href="/">About</a>
                </li>
                <li>
                  <a href="/">Terms of use</a>
                </li>
                <li>
                  <a href="/">Contact Us</a>
                </li>
                {/* <li>
                  <a href="/">©2020 BuyPower Inc. Datapex Drifty Technologies. All Rights Reserved</a>
                </li> */}
              </ul>
              <ul className="datapex">
                <li>
                  <a href="/">©2020 BuyPower Inc. Datapex Drifty Technologies. All Rights Reserved</a>
                </li>
              </ul>
            </div>
          </div>
        </footer>
        {/* <!-- End Footer --> */}
        {/* 
            <div id="preloader"></div>


            <!-- Vendor JS Files -->
            <script src={require("../layout/assets/vendor/glightbox/js/glightbox.min.js"></script>
            <script src={require("../layout/assets/vendor/isotope-layout/isotope.pkgd.min.js"></script>
            <script src={require("../layout/assets/vendor/swiper/swiper-bundle.min.js"></script>

            <!-- Template Main JS File -->
            <script src={require("../layout/assets/js/main.js"></script> */}

        {/* </body> */}
      </div>
    )
  }
}

export default Home;
